import React from 'react'
import './'

function CreditCard({cardInfo}) {
    return (
        <div className='Card'>

            <p>{ cardInfo.bankName }</p>            
            <p>{ cardInfo.creditCardNum }</p>
            <p>Valid THRU { cardInfo.expirationData }</p>            
            <p>{ cardInfo.userName }</p>            
        </div>
    )
}

export default CreditCard
